-- ------------------------------------------------------------
-- Script de création de la base de données AdventureWorks
-- MS SQL Server
-- ------------------------------------------------------------

USE master;
GO

DROP DATABASE IF EXISTS AdventureWorks;
GO

CREATE DATABASE AdventureWorks;
GO

USE AdventureWorks;
GO


-- Nettoyage de l'environnement
-- ----------------------------
DROP TABLE IF EXISTS EmployeeDepartmentHistory;
DROP TABLE IF EXISTS EmployeePayHistory;
DROP TABLE IF EXISTS Department;
DROP TABLE IF EXISTS Shift;
DROP TABLE IF EXISTS Employee;

DROP TABLE IF EXISTS BusinessEntityAddress;
DROP TABLE IF EXISTS Address;
DROP TABLE IF EXISTS AddressType;
DROP TABLE IF EXISTS BusinessEntity;

DROP TABLE IF EXISTS CountryRegion;
DROP TABLE IF EXISTS EmailAddress;


DROP TABLE IF EXISTS PhoneNumberType;
DROP TABLE IF EXISTS PersonPhone;
DROP TABLE IF EXISTS Person;

DROP TABLE IF EXISTS SalesReason;
DROP TABLE IF EXISTS SalesPersonQuotaHistory;
DROP TABLE IF EXISTS StateProvince;
DROP TABLE IF EXISTS SalesPerson;


DROP TABLE IF EXISTS SalesTerritoryHistory;
DROP TABLE IF EXISTS SalesTerritory;


-- CRéation des tables
-- -------------------
CREATE TABLE SalesTerritory (
  TerritoryID int PRIMARY KEY NOT NULL,
  Name nvarchar(14) DEFAULT NULL,
  CountryRegionCode nvarchar(2) DEFAULT NULL,
  Groupe nvarchar(13) DEFAULT NULL,
  SalesYTD decimal(12,4) DEFAULT NULL,
  SalesLastYear decimal(11,4) DEFAULT NULL,
  CostYTD decimal(5,4) DEFAULT NULL,
  CostLastYear decimal(5,4) DEFAULT NULL,
  rowguid nvarchar(36) DEFAULT NULL,
  ModifiedDate date DEFAULT NULL
);


CREATE TABLE SalesTerritoryHistory (
  SalesTerritoryHistoryID int PRIMARY KEY IDENTITY (1,1),
  BusinessEntityID int NOT NULL,
  TerritoryID int FOREIGN KEY REFERENCES SalesTerritory  NULL,
  StartDate date DEFAULT NULL,
  EndDate date DEFAULT NULL,
  rowguid nvarchar(36) DEFAULT NULL,
  ModifiedDate date DEFAULT NULL
);

CREATE TABLE StateProvince (
  StateProvinceID int PRIMARY KEY NOT NULL,
  StateProvinceCode nvarchar(3) DEFAULT NULL,
  CountryRegionCode nvarchar(2) DEFAULT NULL,
  IsOnlyStateProvinceFlag int DEFAULT NULL,
  Name nvarchar(24) DEFAULT NULL,
  TerritoryID int FOREIGN KEY REFERENCES SalesTerritory,
  rowguid nvarchar(36) DEFAULT NULL,
  ModifiedDate datetime DEFAULT NULL
);


CREATE TABLE SalesPerson (
  BusinessEntityID int PRIMARY KEY NOT NULL,
  TerritoryID int FOREIGN KEY REFERENCES SalesTerritory,
  SalesQuota decimal(11,4) DEFAULT NULL,
  Bonus DECIMAL(8,4) DEFAULT NULL,
  CommissionPct DECIMAL(5,4) DEFAULT NULL,
  SalesYTD decimal(11,4) DEFAULT NULL,
  SalesLastYear decimal(11,4) DEFAULT NULL,
  rowguid nvarchar(36) DEFAULT NULL,
  ModifiedDate date DEFAULT NULL
);

CREATE TABLE SalesPersonQuotaHistory (
  SalesPersonQuotaHistoryID int PRIMARY KEY IDENTITY (1,1),
  BusinessEntityID int NOT NULL,
  QuotaDate date DEFAULT NULL,
  SalesQuota decimal(11,4) DEFAULT NULL,
  rowguid nvarchar(36) DEFAULT NULL,
  ModifiedDate date DEFAULT NULL
);


CREATE TABLE SalesReason (
  SalesReasonID int PRIMARY KEY NOT NULL,
  Name nvarchar(25) DEFAULT NULL,
  ReasonType nvarchar(15) DEFAULT NULL,
  ModifiedDate date DEFAULT NULL
);

CREATE TABLE Person (
  BusinessEntityID int PRIMARY KEY NOT NULL,
  PersonType nvarchar(2) DEFAULT NULL,
  NameStyle int DEFAULT NULL,
  Title nvarchar(4) DEFAULT NULL,
  FirstName nvarchar(24) DEFAULT NULL,
  MiddleName nvarchar(16) DEFAULT NULL,
  LastName nvarchar(22) DEFAULT NULL,
  Suffix nvarchar(3) DEFAULT NULL,
  EmailPromotion int DEFAULT NULL,
  AdditionalContactInfo nvarchar(100),
  Demographics nvarchar(100),
  rowguid nvarchar(36) DEFAULT NULL,
  ModifiedDate date DEFAULT NULL
);


CREATE TABLE PhoneNumberType (
  PhoneNumberTypeID int PRIMARY KEY NOT NULL,
  Name nvarchar(4) DEFAULT NULL,
  ModifiedDate date DEFAULT NULL
);


CREATE TABLE PersonPhone (
  BusinessEntityID int PRIMARY KEY NOT NULL,
  PhoneNumber nvarchar(19) DEFAULT NULL,
  PhoneNumberTypeID int FOREIGN KEY REFERENCES PhoneNumberType,
  ModifiedDate date DEFAULT NULL
);


CREATE TABLE EmailAddress (
  BusinessEntityID int PRIMARY KEY NOT NULL,
  EmailAddressID int DEFAULT NULL,
  EmailAddress nvarchar(43) DEFAULT NULL,
  rowguid nvarchar(36) DEFAULT NULL,
  ModifiedDate date DEFAULT NULL
);


CREATE TABLE CountryRegion (
  CountryRegionCode nvarchar(2) PRIMARY KEY NOT NULL,
  Name nvarchar(44) DEFAULT NULL,
  ModifiedDate date DEFAULT NULL
);


CREATE TABLE BusinessEntity (
  BusinessEntityID int PRIMARY KEY NOT NULL,
  rowguid nvarchar(36) DEFAULT NULL,
  ModifiedDate date DEFAULT NULL
);


CREATE TABLE Address (
  AddressID int PRIMARY KEY NOT NULL,
  AddressLine1 nvarchar(39) DEFAULT NULL,
  AddressLine2 nvarchar(28) DEFAULT NULL,
  City nvarchar(21) DEFAULT NULL,
  StateProvinceID smallint DEFAULT NULL,
  PostalCode nvarchar(10) DEFAULT NULL,
  SpatialLocation nvarchar(44) DEFAULT NULL,
  rowguid nvarchar(36) DEFAULT NULL,
  ModifiedDate date DEFAULT NULL
);


CREATE TABLE AddressType (
  AddressTypeID int PRIMARY KEY NOT NULL,
  Name nvarchar(11) DEFAULT NULL,
  rowguid nvarchar(36) DEFAULT NULL,
  ModifiedDate date DEFAULT NULL
);

CREATE TABLE BusinessEntityAddress (
  BusinessEntityID int PRIMARY KEY NOT NULL,
  AddressID int FOREIGN KEY REFERENCES Address,
  AddressTypeID int FOREIGN KEY REFERENCES AddressType,
  rowguid nvarchar(36) DEFAULT NULL,
  ModifiedDate date DEFAULT NULL
);


CREATE TABLE Employee (
  BusinessEntityID int PRIMARY KEY NOT NULL,
  NationalIDNumber int DEFAULT NULL,
  LoginID nvarchar(28) DEFAULT NULL,
  OrganizationNode nvarchar(8) DEFAULT NULL,
  OrganizationLevel nvarchar(1) DEFAULT NULL,
  JobTitle nvarchar(40) DEFAULT NULL,
  BirthDate date DEFAULT NULL,
  MaritalStatus nvarchar(1) DEFAULT NULL,
  Gender nvarchar(1) DEFAULT NULL,
  HireDate date DEFAULT NULL,
  SalariedFlag int DEFAULT NULL,
  VacationHours int DEFAULT NULL,
  SickLeaveHours int DEFAULT NULL,
  CurrentFlag int DEFAULT NULL,
  rowguid nvarchar(36) DEFAULT NULL,
  ModifiedDate date DEFAULT NULL
);

CREATE TABLE Shift (
  ShiftID int PRIMARY KEY NOT NULL,
  Name nvarchar(7) DEFAULT NULL,
  StartTime nvarchar(8) DEFAULT NULL,
  EndTime nvarchar(8) DEFAULT NULL,
  ModifiedDate date DEFAULT NULL
);


CREATE TABLE Department (
  DepartmentID int PRIMARY KEY NOT NULL,
  Name nvarchar(26) DEFAULT NULL,
  GroupName nvarchar(36) DEFAULT NULL,
  ModifiedDate date DEFAULT NULL
);


CREATE TABLE EmployeeDepartmentHistory (
  DepartmentHistoryID int PRIMARY KEY IDENTITY (1,1),
  BusinessEntityID int NOT NULL,
  DepartmentID int FOREIGN KEY REFERENCES Department,
  ShiftID int FOREIGN KEY REFERENCES Shift,
  StartDate date DEFAULT NULL,
  EndDate date DEFAULT NULL,
  ModifiedDate date DEFAULT NULL
);


CREATE TABLE EmployeePayHistory (
  PayHistoryID int PRIMARY KEY IDENTITY (1,1),
  BusinessEntityID int NOT NULL,
  RateChangeDate date DEFAULT NULL,
  Rate decimal(7,4) DEFAULT NULL,
  PayFrequency int DEFAULT NULL,
  ModifiedDate date DEFAULT NULL
);

